import React, {useState} from 'react';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import LikedMovieRouter from './components/LikedMoviesRoute';
import MoviesRoute from './components/MoviesRoute';
import Navigation from './components/nav/Navigation';
function App(props) {
  const [likedMovies, setLikedMovies] = useState([]);
  const passLikedMoviesHandler = movieData => {
    setLikedMovies(movieData);
    console.log(movieData);
    console.log(likedMovies);
  };
  return (
    <div className="App">
      <Navigation />
      {/* -------------- Beginning of router ----------------- */}
      <Router>
        <Routes>
          <Route
            path="/"
            element={<MoviesRoute userLikedMovies={passLikedMoviesHandler} />}
          />
          <Route
            path="/liked"
            element={<LikedMovieRouter getData={likedMovies} />}
          />
        </Routes>
      </Router>
      {/* -------------- End of Router ---------------- */}
    </div>
  );
}

export default App;
